import React, { useState, useEffect } from "react";

export default function States({ onSelectState }) {
  const [states] = useState([
    "Andhra Pradesh",
    "Arunachal Pradesh",
    "Assam",
    "Bihar",
    "Chhattisgarh",
    "Goa",
    "Gujarat",
    "Haryana",
    "Himachal Pradesh",
    "Jharkhand",
    "Karnataka",
    "Kerala",
    "Madhya Pradesh",
    "Maharashtra",
    "Manipur",
    "Meghalaya",
    "Mizoram",
    "Nagaland",
    "Odisha",
    "Punjab",
    "Rajasthan",
    "Sikkim",
    "Tamil Nadu",
    "Telangana",
    "Tripura",
    "Uttar Pradesh",
    "Uttarakhand",
    "West Bengal",
    "Delhi",
    "Puducherry",
    "Jammu and Kashmir",
    "Ladakh",
  ]);

  const [selectedState, setSelectedState] = useState(null);
  const [places, setPlaces] = useState([]);

  useEffect(() => {
    if (selectedState) {
      fetch(`http://localhost:8000/places?state=${encodeURIComponent(selectedState)}`)
        .then((r) => r.json())
        .then(setPlaces)
        .catch((e) => console.error(e));
    }
  }, [selectedState]);

  return (
    <div style={page}>
      <h1 style={heading}>Indian States</h1>

      {/* State Buttons Section */}
      {!selectedState && (
        <div style={buttonGrid}>
          {states.map((st) => (
            <button
              key={st}
              style={stateButton}
              onClick={() => {
                setSelectedState(st);
                if (onSelectState) onSelectState(st);
              }}
            >
              {st}
            </button>
          ))}
        </div>
      )}

      {/* Places Section */}
      {selectedState && (
        <div style={placesSection}>
          <button style={backBtn} onClick={() => setSelectedState(null)}>
            ‚Üê Back to States
          </button>
          <h2 style={stateTitle}>{selectedState}</h2>

          {places.length === 0 ? (
            <p style={{ textAlign: "center" }}>No places found for this state.</p>
          ) : (
            <div style={placesGrid}>
              {places.map((p) => (
                <div key={p.id} style={placeCard}>
                  <h3>{p.name}</h3>
                  <p>{p.description?.slice(0, 120)}...</p>
                  {p.photos && p.photos[0] && (
                    <img
                      src={`http://localhost:8000/uploads/${p.photos[0]}`}
                      alt={p.name}
                      style={photo}
                    />
                  )}
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
}

// --- Styles ---
const page = {
  padding: "20px",
  background: "#f0f8ff",
  minHeight: "100vh",
};

const heading = {
  textAlign: "center",
  fontSize: "2em",
  marginBottom: "20px",
  fontWeight: "bold",
  color: "#004080",
};

const buttonGrid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(160px, 1fr))",
  gap: "15px",
  justifyItems: "center",
};

const stateButton = {
  background: "#007bff",
  color: "white",
  border: "none",
  borderRadius: "8px",
  padding: "12px 20px",
  width: "100%",
  fontSize: "1em",
  cursor: "pointer",
  transition: "background 0.3s, transform 0.2s",
};
stateButton[":hover"] = {
  background: "#0056b3",
  transform: "scale(1.03)",
};

const placesSection = {
  textAlign: "center",
};

const backBtn = {
  marginBottom: "15px",
  padding: "8px 16px",
  background: "#ff5722",
  color: "white",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer",
};

const stateTitle = {
  fontSize: "1.6em",
  marginBottom: "10px",
  color: "#004080",
};

const placesGrid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(240px, 1fr))",
  gap: "20px",
  marginTop: "20px",
};

const placeCard = {
  background: "white",
  borderRadius: "10px",
  padding: "10px",
  boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
};

const photo = {
  width: "100%",
  height: "150px",
  borderRadius: "8px",
  objectFit: "cover",
  marginTop: "8px",
};
